window.bookSummaryJSON = "<p>My life is in ruins. Failed marriage, failed career - I'm a failure.</p> <p>My husband may have had a hand in it, but I can't help missing him.</p> <p>We made an agreement. I signed the contract, and so did he. Without our arrangement, everything falls apart.</p> <p>So we'll keep losing ourselves in each other's bodies.</p> <p>We'll keep pretending everything is fine.</p> <p>But maybe I'm getting sick of pretend.</p> <p>Maybe I want to find something real.</p> <p>And just maybe, Luka does too.</p> <p>Book three&nbsp;of three.</p>"; 
